import React, { useState, useEffect } from 'react';
import {Count} from './data'
import OurCard from './Card'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import { useContext } from 'react';

const useStyles = makeStyles(() => ({

    paper: {
        height: 140,
        width: 100,
    },

}));
export default function Mercedes(props) {
    const count = useContext(Count)
    const [product, setProduct] = useState({})
    const dataChange = () => {
        setProduct({ product: props, onChange: dataChange })
      
    }
    useEffect(() => {
        dataChange()
    }, [])
    const classes = useStyles();
    return (
        <div>
            
                <Grid container justify="center">
                    {props.ndata.map((value) => (
                        <Grid key={value} >
                            <OurCard className={classes.paper} value={value} count={count} />
                        </Grid>
                    ))}
                </Grid>
           
        </div>

    )
}
